		{
			name: 'help',
			shortcut: 'h',
			handle(app: Application) {
				if (app.version) app.log(app.version);
				process.exit(0);
			},
		},
		{
			name: 'config',
			help: 'Use JSON config file',
			shortcut: 'c',
			handle(app: Application, fileName: string) {
				app.parameters.parseJsonFile(fileName);
			},
		},
	]
